class AbsDirectory():
    def __init__(self, name):
        self.name = name
        self.isRoot, self.parent, self.children = None, None, None
        self.children, self.file_children, self.directory_children = [], [], []
        self.parent, self.isRoot = False, False
        self.depth = 0

    @classmethod
    def isFile(cls): return True if cls.__name__ == "File" else False
    @classmethod
    def isDirectory(cls): return True if cls.__name__ == "Directory" else False

    def haschildren(self): return True if not self.children == None else False
    def hasParent(self): return True if not self.parent == None else False

    def get_path(self): return self.parent.get_path() + os.sep + self.name if not self.isRoot else self.name

    def get_depth(self): return self.parent.get_depth()+1 if not self.isRoot else 0 ### deldeldel


class File(AbsDirectory):
    def __init__(self, name, dire):
        AbsDirectory.__init__(self, name)
        self.parent = dire
        self.children = None
        self.isRoot = False

        self.depth = self.get_depth()

    def add_child(self): return False
    def get_parent(self): return self.parent


class Directory(AbsDirectory):
    def __init__(self, name, parent=None):
        AbsDirectory.__init__(self, name)
        self.children, self.file_children, self.directory_children = [], [], []
        (self.parent, self.isRoot) = (parent, False) if parent else (False, True) # if there is no parent then it is root
        self.depth = self.get_depth()

    def add_child(self, child):
        if child.get_path() not in [dire.get_path() for dire in self.children]:
            self.children.append(child)
            return True
        else:
            return False

    def get_children_file_list(self):
        cur_fil_list=[]
        for dire in self.children:
            if dire.isFile(): 
                cur_fil_list.append(dire)
            else:
                cur_fil_list.extend(dire.get_children_file_list())
        return cur_fil_list

    def make_child_directory(self, name):
        if name not in [dire.name for dire in self.children]:
            new_path = self.get_path() + os.sep + name
            if not os.path.exists(new_path):
                os.makedirs(new_path)
            cur_dire = Directory(name, self)
            self.add_child(cur_dire)
            return cur_dire
        return False

    def child_exist(self, name): return True if name in [dire.name for dire in self.children] else False


class Dir_tree():
    def __init__(self, rootPath):
        self.file_list = []
        self.root = Directory(rootPath)
        self.directory_list = [self.root] if rootPath else []
        self.file_list=[]
        self.depth_dict = {i:[] for i in range(100)}
        self.depth_dict[0].append(self.root)
        self.path_dict = {}

        if rootPath:
            self.root.depth = 0
            self.set_root_dir()

    def add_dir_child(self, dire, child): 
        if dire.add_child(child): self.directory_list.append(child)

    def search_path(self, path):
        cur_dir = [dire for dire in itertools.chain(self.file_list, self.directory_list) if path==dire.get_path()]
        return cur_dir[0] if cur_dir else False

    def get_tree(self):
        self.root.children=[]
        for root_path, dirs, files in os.walk(self.root.get_path()):
            if root_path == self.root.get_path():
                cur_root = self.root
            elif root_path in [dire.get_path() for dire in self.directory_list if root_path == dire.get_path()]:
                cur_root = [dire for dire in self.directory_list if root_path == dire.get_path()][0]
            if dirs:
                for dire in dirs:
                    _cur_dir=Directory(name=dire, parent=cur_root)
                    cur_root.children.append(_cur_dir)
                    cur_root.directory_children.append(_cur_dir)
                    self.directory_list.append(_cur_dir)
                    self.depth_dict[_cur_dir.depth].append(_cur_dir)
            if files:
                for file in files:
                    _cur_fil=File(name=file, dire=cur_root)
                    cur_root.children.append(_cur_fil)
                    cur_root.file_children.append(_cur_fil)
                    self.file_list.append(_cur_fil)
                    self.depth_dict[_cur_fil.depth].append(_cur_fil)

        for i in range(100):
            if not self.depth_dict[i]:
                del self.depth_dict[i]
        self.path_dict = {dire.get_path()[len(self.root.get_path()):]:'' for dire in itertools.chain(self.file_list, self.directory_list)}


    def tespri(self):
        print("files are ", len(self.file_list))
        print("directories are ", len(self.directory_list))


class Reader(Dir_tree):
    CLASS_NAME='Reader'
    def __init__(self, rootPath):
        Dir_tree.__init__(self, rootPath)

    def get_root_directory(self): return self.root

    def refresh(self): self.__init__(self.root.get_path())

    def get_depth_file_list(self, depth): return [ele for ele in self.file_list if ele.depth == depth]

    def get_children_file_list(self, dire):
        return dire.get_children_file_list()

    def get_children_ext_files_dict(self, dire_list, ext):
        dic = {}
        for key in dire_list:
            dic[key] = [ele for ele in key.get_children_file_list() if ele.name.find(ext) > 0]
        return dic

    def get_children_ext_files_list(self, dire, ext):
        aaa = [ele for ele in dire.get_children_file_list() if ext in ele.name]
        return aaa

    def copy_tree_to_here(self, creader):
        self.depth_dict = {i:[] for i in range(100)}
        self.depth_dict[0].append(self.root)

        for depth in range(len(creader.depth_dict)):
            for cop_dire in creader.depth_dict[depth]:
                if cop_dire.directory_children:
                    for cop_dire_child in [dire for dire in cop_dire.directory_children]:
                        if cop_dire_child.get_path()[len(creader.root.get_path()):] in self.path_dict:continue
                        des_dire = [dire for dire in self.directory_list if dire.get_path()[len(self.root.get_path()) :] == cop_dire.get_path()[len(creader.root.get_path()) :] ][0] if not cop_dire.isRoot else self.root
                        _cur_dir_child = Directory(cop_dire_child.name, des_dire)
                        des_dire.children.append(_cur_dir_child)
                        if not os.path.exists(_cur_dir_child.get_path()): os.makedirs(_cur_dir_child.get_path())
                        self.directory_list.append(_cur_dir_child)
                        self.depth_dict[depth+1].append(_cur_dir_child)

        for i in range(100):
            if not self.depth_dict[i]:
                del self.depth_dict[i]
        self.path_dict = {dire.get_path()[len(self.root.get_path()):]:'' for dire in itertools.chain(self.file_list, self.directory_list)}

    def make_dir(self, parent_dir, adding_dir_name):
        _cur_res = parent_dir.make_child_directory(adding_dir_name)
        if _cur_res:
            self.add_dir_child(parent_dir, _cur_res)
            self.directory_list.append(_cur_res)
        return _cur_res

    def testit(self,printit=1):
        # print(111, __name__, self.depth_dict)
        if printit: print(222, __name__, [(i,dire.name[0:5]) for i in range(len(self.depth_dict)) for dire in self.depth_dict[i]])
        # print(333, __name__, self.get_depth_file_list(self.root))
        print(444, __name__, [d.name for d in self.root.children])
        print(555, __name__, [d.name for d in self.root.children[2].children])
        # print(666, __name__, [d.name for d in self.root.children[2].children[0].children[0].children[0].children[0].children])
        print(777, __name__,[print(i,dire.name) for i,dire in enumerate(self.get_children_ext_files_list(self.root, 'txt'))] )

